import React from 'react';
import { NavLink } from 'react-router-dom';

import NavigationItem from './NavigationItem';

const navigationItem =( props )=>{
  return(
    <NavigationItem
      link="/login"
      exact
    >
    Login
    </NavigationItem>
  );
};

export default navigationItems;
